package daos.impl;

import daos.FileDao;
import models.File;
import org.junit.Before;
import org.junit.Test;

import java.sql.Connection;
import java.util.List;

import static org.assertj.core.api.Assertions.assertThat;
import static org.assertj.core.api.Assertions.tuple;

/**
 * Created by vvinc_000 on 13/03/2017.
 */
public class FileDaoImplTestCase
{
    private FileDao fileDao;


    @Before
    public void initDatabase() throws Exception
    {
        fileDao = new FileDaoImpl();
        //test connection
        Connection connection = DataSourceFactory.getDataSource().getConnection();
        connection.close();
    }


    @Test
    public void shouldListFiles() throws Exception
    {
        // WHEN
        List<File> files = fileDao.listFiles();
        // THEN
        assertThat(files).hasSize(108);
        assertThat(files).extracting("id", "filename", "parent", "iv", "cryptedStringContent")
                .contains(tuple(235, "UekhwWJBu9xB10o8FGnMv0GIivJYohG9IedjKOr7i2U=", "+J0PcijVI40KARebZxe4Dw==", "BFhXOm4J30FkoWwRV1jNmw==", ""),
                        tuple(236, "oOs11Fg32R9pFUIYPUECh15kqxxLtF/N/8y6LiD571A=", "+J0PcijVI40KARebZxe4Dw==", "BFhXOm4J30FkoWwRV1jNmw==", ""),
                        tuple(342, "LKiOowZVytucHUpKaj8MQw==", "crdUnSW60IkzJzHgxGIQ2w==", "BFhXOm4J30FkoWwRV1jNmw==", "")
                );
    }


}
